import { NavLink } from "react-router-dom";
import './Navbar.css'

export const Navbar = () => {
    return (
        <nav>
            <a>IOT Dashboard</a>
            <div id="navbarNav">
                <ul className="navbar-nav">
                <li><NavLink to="/">Home</NavLink></li>
                <li><NavLink to="/about">About</NavLink></li>
                </ul>
            </div>
        </nav>
    )
}
